import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { RootState } from '../store/store';
import { reserveCar } from '../features/cars/carSlice';

const ReservationForm: React.FC = () => {
  const [selectedCarId, setSelectedCarId] = useState<number | null>(null);
  const [startDate, setStartDate] = useState('');
  const [days, setDays] = useState(1);
  const dispatch = useDispatch();
  const cars = useSelector((state: RootState) => state.cars.cars);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (selectedCarId && startDate) {
      dispatch(reserveCar({ carId: selectedCarId, startDate, days }));
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Reserve a Car</h2>
      <div>
        <label>Car Type:</label>
        <select onChange={e => setSelectedCarId(parseInt(e.target.value))}>
          <option value="">Select...</option>
          {cars.filter(car => car.available).map(car => (
            <option key={car.id} value={car.id}>
              {car.type}
            </option>
          ))}
        </select>
      </div>
      <div>
        <label>Start Date:</label>
        <input type="date" value={startDate} onChange={e => setStartDate(e.target.value)} />
      </div>
      <div>
        <label>Days:</label>
        <input type="number" value={days} onChange={e => setDays(parseInt(e.target.value))} />
      </div>
      <button type="submit">Reserve</button>
    </form>
  );
};

export default ReservationForm;
